{"domain": "vseinstrumenti.ru", "place_in_search": 1, "details_num": 15, "details": [" \u0420\u0443\u043a\u0430\u0432 \u0433\u0430\u0437\u043e\u0441\u0432\u0430\u0440\u043e\u0447\u043d\u044b\u0439 I-6,3-0,63-\u0423 \u0413\u041e\u0421\u0422 9356", " \u0413\u0430\u0439\u043a\u0430 \u0448\u0435\u0441\u0442\u0438\u0433\u0440\u0430\u043d\u043d\u0430\u044f M30.6 \u043f\u043e\u043a\u0440\u044b\u0442\u0438\u0435 \u0446\u0438\u043d\u043a\u043e\u0432\u043e\u0435 \u0413\u041e\u0421\u0422 5915", " \u0413\u0432\u043e\u0437\u0434\u044c \u0441\u0442\u0440\u043e\u0438\u0442\u0435\u043b\u044c\u043d\u044b\u0439 \u043a\u0440\u0443\u0433\u043b\u044b\u0439 \u0433\u043e\u043b\u043e\u0432\u043a\u0430 \u043f\u043b\u043e\u0441\u043a\u0430\u044f 3\u044580 \u0413\u041e\u0421\u0422 4028", " \u0411\u041e\u041b\u0422; \u0421\u0422\u0410\u041d\u0414\u0410\u0420\u0422 \u0413\u041e\u0421\u04227817 DIN609, \u041e\u0411\u041e\u0417\u041d\u0410\u0427\u0415\u041d\u0418\u0415 M36-6G\u0425200, \u041a\u041b\u0410\u0421\u0421 \u041f\u0420\u041e\u0427\u041d\u041e\u0421\u0422\u0418 10.9, \u041c\u0410\u0422\u0415\u0420\u0418\u0410\u041b \u0421\u0422\u0410\u041b\u042c 40\u0425", " \u0411\u043e\u043b\u0442 \u0433\u043e\u043b\u043e\u0432\u043a\u0430 \u0448\u0435\u0441\u0442\u0438\u0433\u0440\u0430\u043d\u043d\u0430\u044f M10\u044535.66 \u043f\u043e\u043a\u0440\u044b\u0442\u0438\u0435 \u0446\u0438\u043d\u043a\u043e\u0432\u043e\u0435 \u0413\u041e\u0421\u0422 7796", " \u0411\u041e\u041b\u0422; \u0421\u0422\u0410\u041d\u0414\u0410\u0420\u0422 \u0413\u041e\u0421\u04227817 DIN609, \u0413\u041e\u041b\u041e\u0412\u041a\u0410 \u0428\u0415\u0421\u0422\u0418\u0413\u0420\u0410\u041d\u041d\u0410\u042f, \u041e\u0411\u041e\u0417\u041d\u0410\u0427\u0415\u041d\u0418\u0415 2.M30\u0425100, \u041a\u041b\u0410\u0421\u0421 \u041f\u0420\u041e\u0427\u041d\u041e\u0421\u0422\u0418 5.8, \u041c\u0410\u0422\u0415\u0420\u0418\u0410\u041b \u0421\u0422\u0410\u041b\u042c", " \u0413\u0430\u0439\u043a\u0430 \u0448\u0435\u0441\u0442\u0438\u0433\u0440\u0430\u043d\u043d\u0430\u044f M24.8 \u0413\u041e\u0421\u0422 5916", " \u0413\u0430\u0439\u043a\u0430 \u0448\u0435\u0441\u0442\u0438\u0433\u0440\u0430\u043d\u043d\u0430\u044f M30.8.35 \u043f\u043e\u043a\u0440\u044b\u0442\u0438\u0435 \u0446\u0438\u043d\u043a\u043e\u0432\u043e\u0435 \u0413\u041e\u0421\u0422 15521", " \u0413\u0410\u0419\u041a\u0410; \u041e\u0411\u041e\u0417\u041d\u0410\u0427\u0415\u041d\u0418\u0415 M10, \u0421\u0422\u0410\u041d\u0414\u0410\u0420\u0422 \u0413\u041e\u0421\u042215521, \u041a\u041b\u0410\u0421\u0421 \u041f\u0420\u041e\u0427\u041d\u041e\u0421\u0422\u0418 5, \u041c\u0410\u0422\u0415\u0420\u0418\u0410\u041b \u0421\u0422\u0410\u041b\u042c \u041e\u0426\u0418\u041d\u041a\u041e\u0412\u0410\u041d\u041d\u0410\u042f", " \u0413\u0430\u0439\u043a\u0430 \u0448\u0435\u0441\u0442\u0438\u0433\u0440\u0430\u043d\u043d\u0430\u044f M20\u04451,5.5 \u043f\u043e\u043a\u0440\u044b\u0442\u0438\u0435 \u0446\u0438\u043d\u043a\u043e\u0432\u043e\u0435, \u0445\u0440\u043e\u043c\u0430\u0442\u0438\u0440\u043e\u0432\u0430\u043d\u043d\u043e\u0435 \u0413\u041e\u0421\u0422\u00a0 15521", " \u0413\u0430\u0439\u043a\u0430 \u0448\u0435\u0441\u0442\u0438\u0433\u0440\u0430\u043d\u043d\u0430\u044f M12.5 \u043f\u043e\u043a\u0440\u044b\u0442\u0438\u0435 \u0446\u0438\u043d\u043a\u043e\u0432\u043e\u0435 \u0413\u041e\u0421\u0422 15521", " \u0413\u0430\u0439\u043a\u0430 \u0448\u0435\u0441\u0442\u0438\u0433\u0440\u0430\u043d\u043d\u0430\u044f M12.8.35 \u043f\u043e\u043a\u0440\u044b\u0442\u0438\u0435 \u0446\u0438\u043d\u043a\u043e\u0432\u043e\u0435 \u0413\u041e\u0421\u0422 15521", " \u0428\u0430\u0439\u0431\u0430 \u043f\u043b\u043e\u0441\u043a\u0430\u044f 16.32 \u0413\u041e\u0421\u0422 6958", " \u0413\u0410\u0419\u041a\u0410; \u041e\u0411\u041e\u0417\u041d\u0410\u0427\u0415\u041d\u0418\u0415 \u041c24-6\u041d.8.35.0112, \u0421\u0422\u0410\u041d\u0414\u0410\u0420\u0422 \u0413\u041e\u0421\u042215521, \u041a\u041b\u0410\u0421\u0421 \u041f\u0420\u041e\u0427\u041d\u041e\u0421\u0422\u0418 8, \