410\u0421\u0421 \u041f\u0420\u041e\u0427\u041d\u041e\u0421\u0422\u0418 5.8, \u041c\u0410\u0422\u0415\u0420\u0418\u0410\u041b \u0421\u0422\u0410\u041b\u042c", " \u0411\u041e\u041b\u0422; \u0421\u0422\u0410\u041d\u0414\u0410\u0420\u0422 \u0413\u041e\u0421\u04227808, \u0413\u041e\u041b\u041e\u0412\u041a\u0410 \u0428\u0415\u0421\u0422\u0418\u0413\u0420\u0410\u041d\u041d\u0410\u042f, \u041e\u0411\u041e\u0417\u041d\u0410\u0427\u0415\u041d\u0418\u0415 \u041c24\u042555, \u041a\u041b\u0410\u0421\u0421 \u041f\u0420\u041e\u0427\u041d\u041e\u0421\u0422\u0418 5.6, \u041c\u0410\u0422\u0415\u0420\u0418\u0410\u041b \u0421\u0422\u0410\u041b\u042c", " \u0411\u041e\u041b\u0422; \u0421\u0422\u0410\u041d\u0414\u0410\u0420\u0422 \u0413\u041e\u0421\u04227796, \u0413\u041e\u041b\u041e\u0412\u041a\u0410 \u0428\u0415\u0421\u0422\u0418\u0413\u0420\u0410\u041d\u041d\u0410\u042f, \u041e\u0411\u041e\u0417\u041d\u0410\u0427\u0415\u041d\u0418\u0415 3M16\u042530, \u041a\u041b\u0410\u0421\u0421 \u041f\u0420\u041e\u0427\u041d\u041e\u0421\u0422\u0418 5.8", " \u0413\u0430\u0439\u043a\u0430 \u0448\u0435\u0441\u0442\u0438\u0433\u0440\u0430\u043d\u043d\u0430\u044f M30.8.35 \u043f\u043e\u043a\u0440\u044b\u0442\u0438\u0435 \u0446\u0438\u043d\u043a\u043e\u0432\u043e\u0435 \u0413\u041e\u0421\u0422 15521", " \u0413\u0410\u0419\u041a\u0410; \u0422\u0418\u041f \u0428\u0415\u0421\u0422\u0418\u0413\u0420\u0410\u041d\u041d\u0410\u042f, \u041e\u0411\u041e\u0417\u041d\u0410\u0427\u0415\u041d\u0418\u0415 M20, \u0421\u0422\u0410\u041d\u0414\u0410\u0420\u0422 \u0413\u041e\u0421\u042215521, \u041a\u041b\u0410\u0421\u0421 \u041f\u0420\u041e\u0427\u041d\u041e\u0421\u0422\u0418 5, \u041c\u0410\u0422\u0415\u0420\u0418\u0410\u041b \u0421\u0422\u0410\u041b\u042c \u041e\u0426\u0418\u041d\u041a\u041e\u0412\u0410\u041d\u041d\u0410\u042f", " \u0413\u0430\u0439\u043a\u0430 \u0448\u0435\u0441\u0442\u0438\u0433\u0440\u0430\u043d\u043d\u0430\u044f M20\u04451,5.5 \u043f\u043e\u043a\u0440\u044b\u0442\u0438\u0435 \u0446\u0438\u043d\u043a