0\u043d\u043d\u0430\u044f M10\u044535.66 \u043f\u043e\u043a\u0440\u044b\u0442\u0438\u0435 \u0446\u0438\u043d\u043a\u043e\u0432\u043e\u0435 \u0413\u041e\u0421\u0422 7796", " \u0411\u041e\u041b\u0422; \u0421\u0422\u0410\u041d\u0414\u0410\u0420\u0422 \u0413\u041e\u0421\u04227798 \u0413\u041e\u0421\u04227805, \u0413\u041e\u041b\u041e\u0412\u041a\u0410 \u0428\u0415\u0421\u0422\u0418\u0413\u0420\u0410\u041d\u041d\u0410\u042f, \u041e\u0411\u041e\u0417\u041d\u0410\u0427\u0415\u041d\u0418\u0415 3.M12\u042525, \u041a\u041b\u0410\u0421\u0421 \u041f\u0420\u041e\u0427\u041d\u041e\u0421\u0422\u0418 5.8, \u041c\u0410\u0422\u0415\u0420\u0418\u0410\u041b \u0421\u0422\u0410\u041b\u042c", " \u0411\u041e\u041b\u0422; \u0421\u0422\u0410\u041d\u0414\u0410\u0420\u0422 \u0413\u041e\u0421\u04227808, \u0413\u041e\u041b\u041e\u0412\u041a\u0410 \u0428\u0415\u0421\u0422\u0418\u0413\u0420\u0410\u041d\u041d\u0410\u042f, \u041e\u0411\u041e\u0417\u041d\u0410\u0427\u0415\u041d\u0418\u0415 \u041c24\u042555, \u041a\u041b\u0410\u0421\u0421 \u041f\u0420\u041e\u0427\u041d\u041e\u0421\u0422\u0418 5.6, \u041c\u0410\u0422\u0415\u0420\u0418\u0410\u041b \u0421\u0422\u0410\u041b\u042c", " \u0411\u041e\u041b\u0422; \u0421\u0422\u0410\u041d\u0414\u0410\u0420\u0422 \u0413\u041e\u0421\u04227796, \u0413\u041e\u041b\u041e\u0412\u041a\u0410 \u0428\u0415\u0421\u0422\u0418\u0413\u0420\u0410\u041d\u041d\u0410\u042f, \u041e\u0411\u041e\u0417\u041d\u0410\u0427\u0415\u041d\u0418\u0415 3M16\u042530, \u041a\u041b\u0410\u0421\u0421 \u041f\u0420\u041e\u0427\u041d\u041e\u0421\u0422\u0418 5.8", " \u0413\u0410\u0419\u041a\u0410; \u0422\u0418\u041f \u0428\u0415\u0421\u0422\u0418\u0413\u0420\u0410\u041d\u041d\u0410\u042f, \u041e\u0411\u041e\u0417\u041d\u0410\u0427\u0415\u041d\u0418\u0415 M20, \u0421\u0422\u0410\u041d\u0414\u0410\u0420\u0422 \u0413\u041e\u0421\u042215521, \u041a\u041b\u0410\u0421\u0421 \u041f\u0420\u041e\u0427\u041d\u041e\u0421\u0422\u0418 5, \u041c\u0410\u0422\u0415\u0420\u0418\u0410\u041b \u0421\u0422\u0410\u041b\u042c \u041e\u0426\u0418\u041d\u041a\u041e\u0412\u0410\u041d\u041d\u0410\u042f", " \u0413\u0410\u0419\u041a\u0410; \u041e\u0411\u041e\u0417\u041d\u0410\u0427\u0415\u041d\u0418\u0415 M10, \u0421\u0422\u0410\u041d\u0414\u0410\u0420\u0422 \u0413\u041e\u0421\u042215521, \u041a\u041b\u0410\u0421\u0421 \u041f\u0420\u041e\u0427\u041d\u041e\u0421\u0422\u0418 5, \u041c\u0410\u0422\u0415\u0420\u0418\u0410\u041b \u0421\u0422\u0410\u041b\u042c \u041e\u0426\u0418\u041d\u041a\u041e\u0412\u0410\u041d\u041d\u0410\u042f", " \u0413\u0410\u0419\u041a\u0410; \u041e\u0411\u041e\u0417\u041d\u0410\u0427\u0415\u041d\u0418\u0415 M16, \u0421\u0422\u0410\u041d\u0414\u0410\u0420\u0422 \u0413\u041e\u0421\u042215521, \u041a\u041b\u0410\u0421\u0421 \u041f\u0420\u041e\u0427\u041d\u041e\u0421\u0422\u0418 5, \u041c\u0410\u0422\u0415\u0420\u0418\u0410\u041b \u0421\u0422\u0410\u041b\u042c \u041e\u0426\u0418\u041d\u041a\u041e\u0412\u0410\u041d\u041d\u0410\u042f", " \u0428\u0410\u0419\u0411\u0410; \u0422\u0418\u041f \u041f\u041b\u041e\u0421\u041a\u0410\u042f \u0423\u041c\u0415\u041d\u042c\u0428\u0415\u041d\u041d\u0410\u042f, \u0421\u0422\u0410\u041d\u0414\u0410\u0420\u0422 \u0413\u041e\u0421\u042210450 DIN433, \u041e\u0411\u041e\u0417\u041d\u0410\u0427\u0415\u041d\u0418\u0415 \u041024, \u041c\u0410\u0422\u0415\u0420\u0418\u0410\u041b \u0421\u0422\u0410\u041b\u042c 20 \u041e\u0426\u0418\u041d\u041a\u041e\u0412\u0410\u041d\u041d\u0410\u042f", " \u0413\u0410\u0419\u041a\u0410; \u041e\u0411\u041e\u0417\u041d\u0410\u0427\u0415\u041d\u0418\u0415 \u041c24-6\u041d.8.35.0112, \u0421\u0422\u0410\u041d\u0414\u0410\u0420\u0422 \u0413\u041e\u0421\u042215521, \u041a\u041b\u0410\u0421\u0421 \u041f\u0420\u041e\u0427\u041d\u041e\u0421\u0422\u0418 8, \u041c\u0410\u0422\u0415\u0420\u0418\u0410\u041b \u0421\u0422\u0410\u041b\u042c 35 \u041e\u0426\u0418\u041d\u041a\u041e\u0412\u0410\u041d\u041d\u0410\u042f", " \u0411\u041e\u041b\u0422; \u0421\u0422\u0410\u041d\u0414\u0410\u0420\u0422 \u0413\u041e\u0421\u0422 \u0420 \u0418\u0421\u041e4014 DIN931 (\u0413\u041e\u0421\u04227798/7805), \u0413\u041e\u041b\u041e\u0412\u041a\u0410 \u0428\u0415\u0421\u0422\u0418\u0413\u0420\u0410\u041d\u041d\u0410\u042f, \u041e\u0411\u041e\u0417\u041d\u0410\u0427\u0415\u041d\u0418\u0415 M16\u042565, \u041a\u041b\u0410\u0421\u0421 \u041f\u0420\u041e\u0427\u041d\u041e\u0421\u0422\u0418 8.8, \u041c\u0410\u0422\u0415\u0420\u0418\u0410\u041b \u0421\u0422\u0410\u041b\u042c/ \u041e\u0426\u0418\u041d\u041a\u041e\u0412\u0410\u041d\u041d\u0410\u042f"], "title": "\u042d\u043b\u0435\u043a\u0442\u0440\u043e\u043d\u043d\u044b\u0439 \u0444\u043e\u043d\u0434 \u043f\u0440\u0430\u0432\u043e\u0432\u043e\u0439 \u0438 \u043d\u043e\u0440\u043c\u0430\u0442\u0438\u0432\u043d\u043e-\u0442\u0435\u0445\u043d\u0438\u0447\u0435\u0441\u043a\u043e\u0439 \u0438\u043d\u0444\u043e\u0440\u043c\u0430\u0446\u0438\u0438 - docs.cntd.ru"}
